import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import '../css/allmystyle.css'

class SelectRoleMid extends Component {


    render() {

        return (
            <div className="forform">
                <div className="textUndrerJT"><span>Лучший сервис <br />для аренды спецтехники<br />и грузового автотранспорта</span></div>
                <div className="textUndrerJT"><span>Пожалуйста, выберите роль<br /> пользователя в системе</span></div>
                <div className="button-big-my">
                    <div className="div-col-my button-big-my ">
                        <Link to={{ pathname: '/client/endReg' }} className="colorWhite button-my button-big-my button-red">Клиент</Link>
                        <Link to={{ pathname: '/contractor/regOne' }} className="colorWhite button-my button-big-my button-red" >Подрядчик</Link>
                    </div>
                </div>
            </div>
        )
    }

}
export default SelectRoleMid
